import React from 'react';
import { createRoot } from 'react-dom/client'; // Use createRoot from react-dom/client
import { BrowserRouter } from 'react-router-dom'; // Import BrowserRouter correctly
import App from './App';
import './styles.css'; // Make sure to import your stylesheet

const container = document.getElementById('root');
const root = createRoot(container); // Create a root.

root.render(
  <BrowserRouter>
    <App />
  </BrowserRouter>
);
